function SlideShowComponent (props) {
    let slidesLength = props.data.map()

    return(
        <div className="slideshow-container">
            <div className="elements">
                <div className="left">
                    <i class="bi bi-chevron-left"></i>
                </div>
                <div className="right">
                    <i class="bi bi-chevron-right"></i>
                </div>
            </div>
            <div>

            </div>
        </div>
    )
}

